import React, {Component} from 'react';
import './App.css';

class App extends Component{

  render(){

    return (
      <header id="header" className="fixed-top">
        <div className="container d-flex align-items-center">

          <h1 className="logo mr-auto"><a href="index.html">BandsInTown</a></h1>

          <nav className="nav-menu d-none d-lg-block">

          </nav>
          <a href="#search-artist" className="get-started-btn scrollto">Search Artist</a>
        </div>
      </header>

    );

  }

}

export default App;
